gree to the collection and use of information in accordance with this Privacy Policy. This Privacy Policy has been created with the help of the <a href=\"https://www.freeprivacypolicy.com/free-privacy-policy-generator/\" target=\"_blank\">Free Privacy Policy Generator</a>\n                    .\n                </p>\n                <h1>Interpretation and Definitions</h1>\n                <h2>Interpretation</h2>\n                <p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\n                <h2>Definitions</h2>\n                <p>For the purposes of this Privacy Policy:</p>\n                <ul>\n                    <li>\n                        <p>\n                            <strong>Account</strong>\n                            means a unique account created for You to access our Service or parts of our Service.\n                        </p>\n                    </li>\n                    <li>\n                        <p>\n                            <strong>Affiliate</strong>\n                            means an entity that controls, is controlled by or is under common control with a party, where &quot;control &quot;means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.\n                        </p>\n                    </li>\n                    <li>\n                        <p>\n                            <strong>Application</strong>\n                            refers to OptiList, the software program provided by the Company.\n                        </p>\n                    </li>\n                    <li>\n                        <p>\n                            <strong>Company</strong>\n                            (referred to as either &quot;the Company &quot;, &quot;We &quot;