        public static async Task WriteFile(HttpListenerContext context, string path_)
        {
            await Task.Run(async () =>
            {
                if (File.Exists(path_))
                {
                    FileInfo i = new FileInfo(path_);
                    if (i.Length >= Int32.MaxValue)
                    {
                        long chunk = 262144;
                        try
                        {
                            using (FileStream fs = File.Open(path_, FileMode.Open))
                            {
                                context.Response.ContentType = MimeTypes.GetMimeType(path_);
                                if (context.Request.HttpMethod.ToLower() != HttpMethod.Head.ToString().ToLower())
                                {
                                    context.Response.AddHeader("Content-disposition", "attachment; filename=" + i.Name);
                                }
                                context.Response.ContentLength64 = fs.Length;
                                context.Response.StatusCode = 200;
                                context.Response.StatusDescription = "Ok";
                                context.Response.AddHeader("Allow-Cross-Allow-Origin", "*");
                                context.Response.AddHeader("Date", DateTime.Now.ToString("r"));
                                context.Response.AddHeader("Last-Modified", File.GetLastWriteTime(path_).ToString("r"));
                                long fileLength = fs.Length;
                                Int32 numberOfChunks = Int32.Parse(Math.Ceiling(Convert.ToDecimal(fileLength / chunk)).ToString()) + 1;
                                for (int a = 0; a < numberOfChunks; a++)
                                {
                                    if (((a * chunk) + chunk) >= fileLength)
                                    {
                                        await GetChunk((fileLength % chunk), context.Response.OutputStream, fs);
                                    }
                                    else
                                    {
                                        await GetChunk(chunk, context.Response.OutputStream, fs);
                                    }
                                }
                            }
                        }
                        catch (Exception e)
                        {
                            string jerror = JsonConvert.SerializeObject(e);
                            File.AppendAllText($"{home_}/.temp/log/Exceptions.txt", DateTime.Now.ToString("u") + (Char)10);
                            File.AppendAllText($"{home_}/.temp/log/Exceptions.txt", jerror + (Char)10);
                            byte[] htmlIndex = Encoding.UTF8.GetBytes(jerror);
                            context.Response.ContentEncoding = Encoding.UTF8;
                            context.Response.ContentType = "application/json";
                            context.Response.ContentLength64 = htmlIndex.Length;
                            context.Response.OutputStream.Write(htmlIndex, 0, htmlIndex.Length);
                            context.Response.StatusCode = 500;
                            context.Response.StatusDescription = "Ok";
                            context.Response.OutputStream.Close();
                        }
                    }
                    else
                    {
                        try
                        {
                            string php_result = String.Empty;
                            string filename = i.Name;
                            string fullName = i.FullName;
                            string fileMime = String.Empty;
                            context.Response.AddHeader("Allow-Cross-Allow-Origin", "*");
                            context.Response.AddHeader("Date", DateTime.Now.ToString("r"));
                            context.Response.AddHeader("Last-Modified", File.GetLastWriteTime(fullName).ToString("r"));
                            bool typeFound = false;
                            if (path_.Contains("acme-challenge"))
                            {
                                context.Response.ContentType = "text/plain";
                                typeFound = true;
                            }
                            if (!typeFound)
                            {
                                switch (i.Extension)
                                {
                                    case ".xspf":
                                        context.Response.ContentType = "application/xspf+xml";
                                        typeFound = true;
                                        break;
                                    case ".php":
                                        context.Response.ContentType = "text/php";
                                        php_result = await php(context, path_);
                                        typeFound = true;
                                        break;
                                    case ".ps1":
                                        context.Response.ContentType = "text/plain";
                                        typeFound = true;
                                        break;
                                    case ".exe":
                                        context.Response.ContentType = "application/octet-stream";
                                        if (context.Request.HttpMethod.ToLower() != HttpMethod.Head.ToString().ToLower())
                                        {
                                            context.Response.AddHeader("Content-disposition", "attachment; filename=" + filename);
                                        }
                                        typeFound = true;
                                        break;
                                    case ".base64":
                                        context.Response.ContentType = "text/plain";
                                        typeFound = true;
                                        break;
                                    default:
                                        fileMime = MimeTypes.GetMimeType(path_);
                                        if (!String.IsNullOrEmpty(fileMime))
                                        {
                                            typeFound = true;
                                            context.Response.ContentType = fileMime;
                                            if (fileMime == "application/octet-stream")
                                            {
                                                if (context.Request.HttpMethod.ToLower() != "head")
                                                {
                                                    context.Response.AddHeader("Content-disposition", "attachment; filename=" + filename);
                                                }
                                            }
                                        }
                                        break;
                                }
                            }
                            if (context.Request.HttpMethod.ToLower() != "head" & String.IsNullOrEmpty(php_result))
                            {
                                using (FileStream input = new FileStream(path_, FileMode.Open))
                                {
                                    byte[] filebytes = ReadFully(input);
                                    context.Response.ContentLength64 = filebytes.Length;
                                    using (Stream outputstream = context.Response.OutputStream)
                                    {
                                        outputstream.Write(filebytes, 0, filebytes.Length);
                                        outputstream.Flush();
                                    };
                                };
                                context.Response.StatusCode = (int)HttpStatusCode.OK;
                                context.Response.StatusDescription = "OK";
                            }
                            else
                            {
                                if (context.Request.HttpMethod.ToLower() == "head")
                                {
                                    context.Response.SendChunked = false;
                                    context.Response.KeepAlive = false;
                                    context.Response.ContentLength64 = i.Length;
                                    context.Response.StatusCode = (int)HttpStatusCode.OK;
                                    context.Response.StatusDescription = "Ok";
                                    context.Response.OutputStream.Close();
                                }
                                else
                                {
                                    byte[] nearBYTES = Encoding.UTF8.GetBytes(php_result);
                                    context.Response.StatusCode = 200;
                                    context.Response.StatusDescription = "Ok";
                                    context.Response.ContentEncoding = Encoding.UTF8;
                                    context.Response.ContentType = "text/html";
                                    context.Response.ContentLength64 = nearBYTES.Length;
                                    context.Response.OutputStream.Write(nearBYTES, 0, nearBYTES.Length);
                                    context.Response.OutputStream.Close();
                                }
                            }
                        }
                        catch (Exception e)
                        {
                            string jerror = JsonConvert.SerializeObject(e);
                            File.AppendAllText($"{home_}/.temp/log/Exceptions.txt", DateTime.Now.ToString("u") + (Char)10);
                            File.AppendAllText($"{home_}/.temp/log/Exceptions.txt", jerror + (Char)10);
                        }
                    }
                }
            });
        }
        public static async Task SendVideo(HttpListenerContext context, string RFILE)
        {
            await Task.Run(() =>
            {
                string name = (new FileInfo(RFILE)).Name;
                string m = String.Empty;
                m = MimeTypes.GetMimeType(RFILE);
                if (!String.IsNullOrEmpty(m))
                {
                    context.Response.ContentType = m;
                }
                else
                {
                    context.Response.ContentType = "application/octet-stream";
                    context.Response.AddHeader("Content-Disposition", "attachment; filename=" + name);
                }
                using (FileStream input = new FileStream(RFILE, FileMode.Open))
                {
                    byte[] filebytes = ReadFully(input);
                    context.Response.ContentLength64 = filebytes.Length;
                    using (Stream outputstream = context.Response.OutputStream)
                    {
                        outputstream.Write(filebytes, 0, filebytes.Length);
                        outputstream.Flush();
                    };
                };
                context.Response.StatusCode = 200;
                context.Response.StatusDescription = "OK";

            });
        }
        private static async Task GetChunk(long this_chunk, Stream outputStream, FileStream inputStream)
        {
            await Task.Factory.StartNew(() =>
            {
                byte[] buffer = new byte[this_chunk];
                int read = inputStream.Read(buffer, 0, buffer.Length);
                outputStream.Write(buffer, 0, buffer.Length);
            });
        }
    }
